import SearchResult from "./SearchResult";

const SearchBar = (props) => {
	return (
		<div>
			<form onSubmit={props.handleSubmit}>
				<input type="text" name="query" />
				<input type="submit" />
			</form>
		</div>
	);
};

export default SearchBar;
